(159, 7, 0, 1, 'IDBI Bank Recruitment , 500 Executive Posts', 'IDBI Bank Vacancy Details:\r\nTotal No. of Posts: 500\r\nName of the Post: Executive\r\n\r\nAge Limit: Candidates age limit should be minimum 20 years and maximum 25 years as on 01-10-2016 (i.e. the applicant must have been born not earlier than 02-10-1991 and not later than 01-10-1996 (both dates inclusive)). Age relaxation is applicable to 05 years for SC/ ST, 03 years for OBC and 10 years for PWD candidates.\r\n\r\nEducational Qualification: Candidates should possess Graduation from a recognized university with minimum 60% marks.\r\n\r\nSelection Process: Candidates will be selected based on written test, online test & medical test.\r\n\r\nApplication Fee: Candidates should pay Rs. 150/- (Intimation Charges) for SC/ ST/ PWD candidates and Rs. 700/- (Application fee + Intimation Charges) for all other candidates through online by using Debit Cards (RuPay/ Visa/ MasterCard/ Maestro), Credit Cards, Internet Banking, IMPS, Cash Cards/ Mobile Wallets.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.idbi.com from 16-11-2016 to 30-11-2016.\r\nImportant Dates:\r\n\r\nStarting Date to Apply Online & Payment of Fee	16-11-2016\r\nLast Date to Apply Online & Payment of Fee	30-11-2016\r\nDate of Pre-Examination training for the SC/ ST/ OBC applicants at all center	26-12-2016 to 31-12-2015\r\nDate of Online Test at all centers	06-01-2017\r\n\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0),
(160, 7, 0, 1, 'SBI Recruitment 2016', 'SBI Vacancy Details:\r\nTotal No.of Posts: 103\r\nName of the Posts:\r\n1. Acquisition Relationship Managers: 34 Posts\r\n2. Relationship Manager: 55 Posts\r\n3. Relationship Manager (Team Lead): 01 Post\r\n4. Zoanl Head/ Senior RM-Sales (Corporate & SMEs): 01 Post\r\n5. Zoanl Head/ Senior RM-Sales (Retail HNI): 02 Posts\r\n6. Compliance Officer: 01 Post\r\n7. Investment Counsellors: 09 Posts\r\n\r\nAge Limit: Candidates age should be between 22 to 35 years for Sl.No-1, 23 to 35 years for Sl.No-2 & 7, 25 to 40 years for Sl.No-3 & 6, 30 to years for Sl.No-4 & 5 as on 01-12-2016. Age relaxation applicable 5 years for SC/ ST , 3 years for OBC, 15 years for PWD (SC/ ST), 13 years for PWD (OBC), 10 years for PWD (GEN) candidates.\r\n\r\nEducational Qualification: Candidates should possess Graduation from Government recognized University or Institution with relevant experiences.\r\n\r\nSelection Process: Candidates will be selected based on Merit & Personal Interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 600/- for General & OBC candidates, Rs. 100/- for SC/ ST/ PWD candidates (non-refundable) through using debit card/ credit card/ Internet Banking.\r\n\r\nImportant Dates:\r\n\r\nStarting Date for Online Application & Fee Payment	25-11-2016\r\nLast Date for Online Application & Fee Payment	12-12-2016 \r\nLast Date for Submission of Hard copy of Application	16-12-2016\r\nLast Date for Editing Application Details	12-12-2016\r\nLast Date for Printing of Online Application	27-12-2016\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0),
(161, 7, 0, 1, 'Bank of Baroda,755 Full Time Sweeper cum Peon/ Peon', 'Bank of Baroda Vacancy Details:\r\nTotal No. of Posts: 755 \r\nName of the Post:\r\n1. Sweeper cum Peon: 265 Posts\r\n2. Peon: 07 Posts\r\n3. Full time Sweeper cum Peon: 143 Posts\r\n4. Full time Sweeper cum Peon: 209 Posts\r\n5. Peon: 08 Posts\r\n6. Sweeper cum Peon: 121 Posts\r\n7. Sweeper cum Peon: 02 Posts\r\n\r\nAge Limit: Candidates age limit should be between 18 â 26 years as on 22-11-2016 for Sl No. 01, as on 13-12-2016 for Sl No. 02, as on 03-12-2016 for Sl No. 03, as on 15-12-2016 for Sl No. 04 & 05. Age relaxation is applicable to 05 years for SC/ ST, 03 years for OBC & 10 years for PWD Candidates.\r\n\r\nEducational Qualification: Candidates should have passed in Xth Standard examination or its equivalent.\r\n\r\nSelection Process: Candidates will be selcted based on merit & examination.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- for SC/ ST/ PWD/ EX SM Candidates and Rs. 400/- for all other candidates through online & off line\r\n\r\nOnline: Candidates should pay fee through online by using Credit Card, Debit Card & Net banking\r\n\r\nOffline: Candidates should pay fee through off line by Pay-in-slip/ Cash Voucher/ Challan.\r\n\r\nImportant Dates:\r\nStarting Date to Apply Online: 23-11-2016\r\nLast Date to Apply Online for Post No. 01 to 05: 13-12-2016\r\nLast Date to Apply Online for Sl No. 06 & 07: 15-12-2016\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0);
