(162, 7, 0, 1, 'PUNJAB POLICE', 'Punjab Police Recruitment 2017 of Constables and Sub Inspector (SI) for Sports Persons (Both Male and Female) in various Cadre of Punjab Police against 3% sports quota. The Punjab Police Online registration start from 24th November 2016 and close on 14th December 2016.\r\n\r\nName of the Post\r\n\r\nTotal Vacancies\r\n\r\nAge Limit (as on 01/01/2016)\r\n\r\nPay Scale\r\n\r\nConstable\r\n\r\n289 (Male â 253, Female â 36)\r\n\r\n18 to 28 Years\r\n\r\nâ¹ 10300-34800 + Grade Pay â¹ 3200/-\r\n\r\nSub Inspector (SI)\r\n\r\n17 (Male â 10, Female â 07)\r\n\r\n18 to 28 Years\r\n\r\nâ¹ 10300-34800 + Grade Pay â¹ 4600/-\r\n\r\nEducational Qualification:\r\n\r\nConstable -> 10+2 or its equivalent from a recognized Education Board/ University and the candidate must have passed matriculation examination with Punjabi as one of the compulsory or elective subjects or any other equivalent examination in Punjabi language.\r\n\r\nSub Inspector -> Graduation / Degree in any discipline for all candidates or its equivalent from a recognized University and the candidate must have passed matriculation examination with Punjabi as one of the compulsory or elective subjects or any other equivalent examination in Punjabi language.\r\n\r\nSports Requirement: Representation by candidate at International level competitions recognized by Indian Olympic Association/ National Federations is mandatory.\r\n\r\nPhysical Standards: Minimum Height required 5\'-5\" Inches for Male, 5\'-2\" Inches for Female (Both posts).\r\n\r\nSelection Process: The Selection Process shall consist of various stages as below:-\r\n\r\nFor Constable ->\r\n\r\n(a) Scrutiny of application forms. \r\n\r\n\r\n(b) Physical Trials consisting of Substance Abuse (Drug Addiction) Test and Physical Measurement Test (PMT). \r\n(c) Sports Trials (Concerned discipline) - 25 marks \r\n(d) Counseling & Scrutiny of sports achievements - 25 Marks (certificates)\r\nFor Sub-Inspector ->\r\n\r\n(a) Scrutiny of application forms. \r\n(b) Physical Trials consisting of Substance Abuse (Drug Addiction) Test and Physical Measurement Test (PMT). \r\n(c) Sports Trials (Concerned discipline) - 20 marks \r\n(d) Scrutiny of sports achievements (certificates) - 25 Marks \r\n(e) Interview-cum-Personality Test - 05 Marks\r\n\r\nApplication Fee: â¹ 700/- for General and OBC category candidates; â¹ 300/- for SC / ST / BC Category candidates. The fee to be paid online / offline mode.\r\n\r\nHow to Apply: Eligible Sports Persons Apply Online through Punjab Police Recruitment Portal from 24/11/2016 to 14/12/2016.\r\n\r\nImportant Dates:\r\n\r\nClosing date for Online Applications -> 14/12/2016 till 11:59 PM \r\nClosing date for deposit of Application Fee (Online) -> 14/12/2016 \r\nClosing date for deposit of Application Fee (Offline) -> 16/12/2016\r\n\r\n\r\nDEPARTMENT OF JAILS. PUNJAB RECRUITMENT OF WARDERS (MALE) /MATRONS (FEMALE)- 2016\r\n\r\nName of the Post\r\n\r\nNo of Vacancies\r\n\r\nWarder (Male)\r\n\r\n210\r\n\r\nMatrons (Female)\r\n\r\n57\r\n\r\nAge Limit: 18 to 25 Years as on 1st January 2016. No relaxation will be given in age to any candidate.\r\n\r\nEducational Qualification: 10+2 (Matric with 12th Class) or its equivalent from a recognized education Board/ University. The candidate must have also passed Matriculation examination with Punjabi as one of the compulsory or elective subjects or any other equivalent examination in Punjabi language.\r\n\r\nSelection Process: Recruitment Boards under the overall supervision of the Central Recruitment Board shall conduct the recruitments for Jail Warders (Male)/ Matrons (Female), The Physical Measurement Test (PMT) and the Physical Screening Test (PST) of a candidate shall be conducted on a single day, and the entire process for each candidate shall be got video-graphed. The candidates will be assigned the nearest Recruitment Centre for PMT and PST. Only candidates who clear the PMT and PST will be enlisted based on the merit list.\r\n\r\nPhysical Measurement Test:\r\n\r\nFor Warders (Male) â>\r\n\r\nCandidate\r\n\r\nMinimum Height required\r\n\r\nChest\r\n\r\nMale\r\n\r\n5 feet 7 inches\r\n\r\n33\' Unexpanded 34-1/2\' Expanded\r\n\r\nDogras/Gurkhas (Mate)\r\n\r\n5 feet 4-1/2 inches\r\n\r\n33\' Unexpanded 34-1/2\' Expanded\r\n\r\nFor Matrons (Female) â>\r\n\r\nCandidate\r\n\r\nMinimum Height required\r\n\r\nWeight\r\n\r\nFemale\r\n\r\n5 Feet 3 inches\r\n\r\n50 Kg and above\r\n\r\nApplication Fee: â¹ 400/- for General Category; â¹ 100/- for SC / ST / BC Category; No fee for Ex-Servicemen candidates. For depositing the fees, the candidate would have an option of either depositing the same online through (i) Net Banking (ii) Credit/Debit Card payment or the candidate can deposit the fees offline manually through the Fee Challan Form available on official website. \r\n\r\nHow to Apply: Eligible Interested candidates shall only apply online through Punjab Police Recruitment Portal on or before 28/11/2016 up to 11:59 PM.\r\n\r\n\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0),
(163, 7, 0, 1, 'Bank of Baroda,755, S.O., SUB STAFF', 'Bank of Baroda (BoB) invites online applications for recruitment of Specialist Officers (SO) in Bank of Baroda Project 2016-17. The Online registration start from 9th November 2016 and close on 2nd December 2016.\r\n\r\nRECRUITMENT OF SPECIALIST OFFICERS IN BANK OF BARODA â PROJECT 2016-17\r\n\r\nName of the Post / Grade\r\n\r\nTotal Vacancies\r\n\r\nScale of Pay\r\n\r\nSpecialist Officer â JMG/S-I\r\n\r\n66\r\n\r\nâ¹ 23700 x 980 [7] - 30560 x 1145(2) - 32850 x 1310(7) - 42020\r\n\r\nSpecialist Officer â MMG/S-II\r\n\r\n676\r\n\r\nâ¹ 31705 x 1145 [1] - 32850 x 1310(10) - 45950\r\n\r\nSpecialist Officer â MMG/S-III\r\n\r\n256\r\n\r\nâ¹ 42020 x 1310 [5] - â¹ 48570 x 1460 [2] - 51490\r\n\r\nSpecialist Officer â SMG/S-IV\r\n\r\n41\r\n\r\nâ¹ 50030 x 1460 [4] - 55870 x 1650 [2] - 59170\r\n\r\nSpecialist Officers Stream wise Vacancies:\r\n\r\nStream\r\n\r\nTotal Vacancies\r\n\r\nAge Limit (as on 01/11/2016)\r\n\r\nPay Scale\r\n\r\nCredit Analysts (Chartered Accountants)\r\n\r\n40\r\n\r\n28 to 40 Years\r\n\r\nS-IV\r\n\r\nFinance /Credit\r\n\r\n440\r\n\r\n28 to 40 Years\r\n\r\nS-ll / S-lll\r\n\r\nTrade Finance\r\n\r\n100\r\n\r\n25 to 32 Years\r\n\r\nS-ll\r\n\r\nTreasury\r\n\r\n29\r\n\r\n25 to 30 Years\r\n\r\nS-ll / S-lll\r\n\r\nRisk Management\r\n\r\n10\r\n\r\n25 to 32 Years\r\n\r\nS-lll\r\n\r\nAgriculture product specialists\r\n\r\n05\r\n\r\n28 to 40 Years\r\n\r\nS-lll\r\n\r\nMarketing\r\n\r\n200\r\n\r\n25 to 32 Years\r\n\r\nS-ll\r\n\r\nPlanning\r\n\r\n68\r\n\r\n23 to 30 Years\r\n\r\nS-l / S-ll\r\n\r\nEconomists\r\n\r\n05\r\n\r\n25 to 30 Years for S-II / 30 to 40 Years for S-IV\r\n\r\nS-ll / S-IV\r\n\r\nLaw\r\n\r\n17\r\n\r\n25 to 32 Years\r\n\r\nS-ll\r\n\r\nInformation Technology\r\n\r\n22\r\n\r\n25 to 30 Years for S-II / 25 to 40 Years for S-III\r\n\r\nS-ll / S-lll\r\n\r\nHRM\r\n\r\n40\r\n\r\n25 to 32 Years for S-II / 28 to 40 Years for S-III\r\n\r\nS-ll / S-lll\r\n\r\nSecurity\r\n\r\n32\r\n\r\n25 to 35 Years\r\n\r\nS-ll\r\n\r\nFire\r\n\r\n09\r\n\r\n21 to 30 Years\r\n\r\nS-l\r\n\r\nElectrical engineers / Civil engineers / Architects\r\n\r\n10\r\n\r\n25 to 32 Years\r\n\r\nS-ll\r\n\r\nOfficial Language (Hindi)\r\n\r\n12\r\n\r\n25 to 32 Years\r\n\r\nS-ll\r\n\r\nEducational Qualification and Experience: (as on 09/11/2016)\r\n\r\nCredit Analysts (Chartered Accountants) -> Qualified Chartered Accountant. Minimum 5 years Post-qualification experience out of which minimum 3 years experience in Large Corporate Banking / Finance.\r\n\r\nFinance / Credit (S-II) -> Full time MBA / Full time PGDBM / Full time PGDM with specialization in Finance / CFA/ ICWA/ CA. Post-qualification experience of minimum 2 years in Credit Processing/ Credit Appraisal, Corporate Credit Relationship Management in Banking/ Financial Sector (Experience of working in Credit Deptt. in large Banks will be preferable). 2 years Full Time PGPM with Specialization in Finance.\r\n\r\nFinance / Credit (S-III) -> Full time MBA / Full time PGDBM / Full time PGDM with specialization in Finance / CFA/ ICWA/ CA. Post-qualification experience of minimum 4 years in Credit Processing/Credit Appraisal, Corporate Credit Relationship Management, in the Banking/ Financial Sector (Experience of working in Credit Deptt. in large Banks will be preferable). For candidates with CA qualification, the Post-qualification experience shall be relaxed to 3 years. 2 years Full Time PGPM with Specialization in Finance.\r\n\r\nTrade Finance -> Full time MBA / Full time PGDBM / Full time PGDM with specialization in Finance / CFA/ ICWA/ CA. Post-qualification experience of minimum 2 years in Credit & Forex / Trade Finance function.in Banking/ Financial Sector (Experience of working in trade finance function including exports / imports / foreign remittances / LC / BG areas in large Banks will be preferable). 2 years Full Time PGPM with Specialization in Finance.\r\n\r\nTreasury - Product Sales -> Full time M.B.A or equivalent with specialization in Marketing, preferably from a premier institution. Minimum 2 to 3 years of Post-qualification experience in Treasury functions of Banks.\r\n\r\nTreasury - Dealers/ Traders -> Graduation or equivalent. Minimum 2 years Post-qualification experience of Trading in Forex and Debt Markets in Banks.\r\n\r\nTreasury -Relationship Managers (Forex/Derivatives) -> Full time M.B.A or equivalent with specialization in Marketing and Sales. Minimum 3 to 5 years of Post-qualification experience as Relationship Manager for Treasury functions/Treasury product sales.\r\n\r\nTreasury - Equity Analyst -> Full time M.B.A or equivalent with specialization in Finance, preferably from a premier institution. CA/CFA/FRM will be preferred. Minimum 3 to 5 years of Post-qualification experience as Equity Analyst in Banks/Corporates.\r\n\r\nRisk Management -> Full Time MBA or Full Time PG in Econometrics/ Statistics/ Financial Risk Management/ Data science or Full Time PG in Risk Mgmt./ Maths/ Economics/ Financial Engg. from a recognized University/ Other reputed Institutions such as Indian Statistical Institution, Kolkata. Knowledge of statistical packages such as SAS/ R / PYTHON etc. is preferable. Post-qualification experience of minimum 2 - 3 years in Credit Rating Model/ Score Card Development / Credit Risk Management/Credit Management / Market Risk / Treasury Operations / Model Validation in the Banking/ Financial Sector.\r\n\r\nAgriculture product specialist -> Graduate Degree with minimum 03 Years post qualification experience.\r\n\r\nMarketing -> Full time MBA / Full time PGDBM / Full time PGDM / Full Time Post-Graduate qualification with specialization in Marketing. Minimum 03 years of experience in a Banking / Financial Services industry of which at least 2 years in same organization as Relationship/ Key Account Manager for sale of liability products (CA, SB, Demat, Credit cards, POS, Internet Payment Gateway, Cash Management Services, etc) or Asset Products (Retail / mortgage loans, etc.)\r\n\r\nPlanning (S-I) -> M.A. Economics or M.Sc. Statistics/M.Com (Banking), or M.Sc./M.A. (Operations Research) or Full Time MBA (Finance) from a recognized university/ reputed institute. Knowledge of MS Office/ Excel/ Access/ PowerPoint is essential.  02 years Full Time PGDM/ 2 years Full Time PG DBM/ 2 years Full Time PGPM with specialization in Finance.\r\n\r\nPlanning (S-II) -> M.A. Economics or M.Sc. Statistics/M.Com (Banking), or M.Sc./M.A. (Operations Research), or Full Time M.B.A (Finance) from a recognized University/ Institute. Knowledge of MS Office/ Excel/ Access/ PowerPoint is essential. Post-qualification experience of minimum 3 years in Statistical Analysis, Forecasting and Budgeting, Data Analysis in the Banking/ Financial Sector. 02 years Full Time PGDM/ 2 years Full Time PG DBM/ 2 years Full Time PGPM with specialization in Finance.\r\n\r\nEconomists (S-II) -> Economics Graduate and M.A (Economics) / Full Time MBA (Finance). Post-qualification experience of minimum 2 years in financial institutions. 02 years Full Time PGDM/ 2 years Full Time PG DBM/ 2 years Full Time PGPM with specialization in Finance.\r\n\r\nEconomist (S-IV) -> Economics Graduate and M.A (Economics). Preferably with M.Phil/Ph. D. in economics. Minimum 6 years Post-qualification experience.\r\n\r\nLaw -> A Bachelor Degree in Law. (Candidates with Higher Qualification and experience will be preferred.) Minimum 03 years post qualification experience.\r\n\r\nIT - Software Development â> 04 years Engineering/ Technology Degree in Computer Science/Computer Science & Engineering/ Computer Engineering/Computer Applications/ Information Technology/ Electronics/ Electronics & Telecommunications/ Electronics & Communication/ Electronics & Instrumentation (OR) Post Graduate Degree in Electronics/ Electronics & Tele Communication/ Electronics & Communication/ Electronics & Instrumentation/ Computer Science/ Information Technology/ Computer Applications (OR) Graduate having passed DOEACC \'B\' level Additional Qualification like Degree/Diploma/ Certificate in Networking, Programming, Languages, Database, IT security, etc. is desirable. Minimum 04 Years post qualification experience.\r\n\r\nIT - Data Scientist -> PhD/MS or equivalents in applied mathematics, statistics, Computer Science. Minimum 04 Years post qualification experience.\r\n\r\nIT - Software Testing -> 04 years Engineering/ Technology Degree in Computer Science/ Computer Science & Engineering/ Computer Engineering/Computer Applications/ Information Technology/ Electronics/ Electronics & Telecommunications/ Electronics & Communication/ Electronics & Instrumentation (OR) Post Graduate Degree in Electronics/ Electronics & Tele Communication/Electronics & Communication/ Electronics & Instrumentation/ Computer Science/ Information Technology/ Computer Applications. (OR) Graduate having passed DOEACC \'B\' level Additional Qualification like Degree/Diploma/ Certificate in Networking, Programming, Languages, Database, IT security, etc. is desirable. Minimum 06 Years post qualification experience.\r\n\r\nIT - Database Management -> 04 year Engineering/ Technology Degree in Computer Science/Computer Science & Engineering/ Computer Engineering/Computer Applications/ Information Technology/ Electronics/ Electronics & Telecommunications/ Electronics & Communication/ Electronics &Instrumentation OR Post Graduate Degree in Electronics/ Electronics & Tele Communication/Electronics & Communication/ Electronics & Instrumentation/ Computer Science/ Information Technology/ Computer Applications OR Graduate having passed DOEACC \'B\' level Additional Qualification like Degree/ Diploma/ Certificate in Networking, Programming, Languages, Database, IT security, etc. is desirable. Minimum 06 Years post qualification experience.\r\n\r\nIT - Data Analyst -> 4 year Engineering/ Technology Degree in Computer Science/ Information Technology (OR) Post Graduate Degree in Computer Science/ Information Technology/ Computer Applications Desirable: Additional qualification like Degree/ Diploma/ Certificate in Networking, Programming languages, Database, IT Security etc.  Minimum 06 Years post qualification experience.\r\n\r\nIT security (CISA) -> 4 year Engineering/ Technology Degree in Computer Science/Computer Science & Engineering/ Computer Engineering/Computer Applications/ Information Technology/ Electronics/ Electronics & Telecommunications/ Electronics & Communication/ Electronics & Instrumentation OR Post Graduate Degree in Electronics/ Electronics & Tele Communication/ Electronics & Communication/ Electronics & Instrumentation/ Computer Science/ Information Technology/ Computer Applications OR Engineering Graduate and minimum One year Diploma in IT / Computer Science from recognised university / Institute (OR) Graduate / Post Graduate in Science / Commerce and minimum One year Diploma in IT / Computer Science from recognised University / Institute. CISA / CISSP / CISM certification is essential. Desirable : ISO 27001 LA Certification. Minimum 3 to 5 years of post qualification experience.\r\n\r\nHRM -> Full time MBA/ Full Time PG DMin HRM/Personnel Management / Industrial Relations/HRD or Full Time Post Graduation (2 Years) in Social Work having specialization in HRM/PM/IR/HRD. Post qualification experience of minimum 2 years in Banks/Financial Institutions in Specialized Area of Human Resources Management including Disciplinary action, HRD, recruitment / promotions, training, performance appraisals, etc. 02 years Full Time PGDBM/ 02 years Full Time PGPM with specialization in HRM/ Personnel Management/ Industrial Relations/ HRD.\r\n\r\nHRM -> Full time MBA/ Full Time PGDM(2 Years) in HRM/Personnel Management / Industrial Relations/HRD or Full Time Post Graduation(2 years) in Social Work having specialization in HRM/PM/IR/HRD. Post qualification experience of minimum 4 years in Banks/Financial Institutions in Specialized Area of Human Resources Management including Disciplinary action, HRD, recruitment / promotions, training, performance appraisals, etc. 02 years Full Time PGDBM/ 02 years Full Time PGPM with specialization in HRM/ Personnel Management/ Industrial Relations/ HRD.\r\n\r\nSecurity -> Graduation degree in any discipline. An officer not below the rank of Captain of Indian Army or equivalent rank in India Navy / Air Force with a minimum of 5 years of commissioned service or an Officer not below the rank of Asst SP/Dy SP/ Asst Comdt/ Dy SP/ Asst Comdt/ Dy Comdt of Indian Police / Para Military Forces with a minimum of 5 years service as an officer in such Force.\r\n\r\nFire -> BE (Fire) or equivalent from National Fire Service College, Nagpur / any other College or Institution duly approved by All India Council for Technical Education (AICTE) (OR) Graduate from a recognized University/ Institute and having Grade I Fire Examination Certificate of IFE (India).\r\n\r\nElectrical Engineers -> BE (Electrical) or equivalent. Minimum 3 years of post-qualification experience in supervising / monitoring electrical work in buildings / projects.\r\n\r\nCivil engineers / Architects -> BE [Civil] or equivalent / B.E. [Architecture] or equivalent. Minimum 3 years of post-qualification experience in construction, purchase/ renovation, maintenance of new & existing premises in large organisation.\r\n\r\nOfficial Language [Hindi] -> M.A. in Hindi OR English OR Sanskrit AND Hindi and English as subject at degree level. Desirable : P.G. Diploma in translation from a recognized Institute. Minimum 2 years post-qualification experience as an Official Language Officer in a Central Government/ Public Sector Bank/ Undertaking/ Financial Institution.\r\n\r\nSelection Process:\r\n\r\n(1) For Scale I Posts -> The selection process will comprise of online written test, in the discipline of Fire and Planning, followed by GD/Interview of the shortlisted candidates. \r\n\r\n\r\n(2) For the posts in Scale II, Scale III & Scale IV -> The applications will be shortlisted and candidates will then be called for GD/Interview. However, for Scale II and Scale III, if the number of eligible applications received is large, then Bank reserves the right to hold an Online Written Test also.\r\nApplication Fee and Intimation Charges (A Non-Refundable): â¹ 100/- for SC / ST / PWD Category candidates; â¹ 600/- for General and OBC Category Candidates. The Candidates have to make the payment of requisite fee/intimation charges through Online mode only. The online payment can be made using only Debit Cards (RuPay/Visa/MasterCard/Maestro), Credit Cards, Internet Banking, IMPS, Cash Cards/ Mobile Wallets.\r\n\r\nHow to Apply: Interested Eligible Candidates are required to Apply Online through Bank of Baroda Online Recruitment Portal on or before 29/11/2016 (Last date extended up to 02/12/2016). \r\n\r\nImportant Dates:\r\n\r\nThe starting date for Online Registration -> 09/11/2016 \r\nThe Last date for Online Registration of Application -> 29/11/2016 \r\nPayment of Fee Online -> 09/11/2016 to 29/11/2016\r\n\r\n\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0),
(164, 7, 0, 1, 'NATIONAL HOUSING BANK', 'National Housing Bank (NHB) invites Online applications for requirement of talented and committed professionals in junior management, senior management and top executive cadre posts in 2016-17. The closing date for online registration is 30th November 2016.\r\n\r\nAbout: National Housing Bank is the apex Financial Institution in the country for housing, set up under an Act of Parliament and is a wholly owned subsidiary of Reserve Bank of India (RBI).\r\n\r\nName of the Post\r\n\r\nNo of Vacancies\r\n\r\nPay Scale\r\n\r\nAssistant Manager (AM)\r\n\r\n14 (General Stream â 12, Law â 01)\r\n\r\nJMG Scale - I â¹ 23700-980/ 7-30560-1145/ 2-32850-1310/ 7-42020\r\n\r\nAssistant General Manager (AGM)\r\n\r\n02 (Law â 01, Economy & Strategy â 01)\r\n\r\nSMG Scale â¹ 59170-1650/2-62470-1800/2-66070\r\n\r\nDeputy General Manager (DGM)\r\n\r\n01\r\n\r\nTEG Scale VI â¹ 68680-1960/ 4-76520\r\n\r\nChief Finance Officer (CFO)\r\n\r\n01\r\n\r\nTEG Scale VII â¹ 76520-2120/ 4-85000\r\n\r\nAge Limit: (Age Relaxation - 05 Years for SC / ST, 03 Years for OBC-NCL, FOr others as per Govt. Rules)\r\n\r\nAssistant Manager -> Candidates must have been born not earlier than 02.10.1988 and not later than 01.10.1995 (both dates inclusive) \r\n\r\n\r\nAssistant General Manager -> Minimum Age Limit is 33 years and Maximum Age limit is 50 years as on 01.10.2016. Candidates must have been born not earlier than 02.10.1966 and not later than 01.10.1983 (both dates inclusive) \r\nDeputy General Manager -> Minimum Age Limit is 35 years and Maximum Age limit is 55 years as on 01.10.2016. Candidates must have been born not earlier than 02.10.1961 and not later than 01.10.1981 (both dates inclusive) \r\nChief Finance Officer -> Minimum Age Limit is 40 years and Maximum Age limit is 55 years as on 01.10.2016 Candidates must have been born not earlier than 02.10.1961 and not later than 01.10.1976 (both dates inclusive)\r\nEducational Qualifications:\r\n\r\nAM (General Stream) ->\r\n\r\n(1) Bachelor\'s Degree in any discipline with minimum of 60% marks (55% in case of candidates belonging to SC/ST) or Master\'s Degree in any discipline with aggregate minimum of 55% marks or CA/ICWA/MBA with minimum 55% marks (50% in case of candidates belonging to SC/ST). \r\n(2) Preference will be given to candidates having Professional/ MBA degree.\r\n\r\nAM (Law) ->\r\n\r\n(1) Bachelor\'s Degree in Law from a recognised University with aggregate minimum of 60% marks Or Master\'s Degree in Law with aggregate minimum of 50%. \r\n(2) While no prior experience is required.\r\n\r\nAGM (Law) ->\r\n\r\n(1) Graduate with a degree in Law or a Law Graduate who has passed 5 years integrated law course from a recognized university in India. \r\n(2) Minimum of 15 years post qualification experience.\r\n\r\nAGM (Economy & Strategy) ->\r\n\r\n(1) A Post Graduate degree in Economics with minimum 50% marks or equivalent from a recognized institute/university. Weightage may be given to candidates with M. Phil / PhD/ other degree and equivalent qualifications. \r\n(2) Minimum of 15 years post qualification experience.\r\n\r\nDGM ->\r\n\r\n(1) Graduate/ Post graduate with a degree in finance/ any other discipline from a recognized Institute/ University. \r\n(2) Minimum of 15 years post qualification experience.\r\n\r\nCFO ->\r\n\r\n(1) Should have strong academic credentials and be a qualified Chartered Accountant. Additional advanced qualifications like CPA, CFA or FSA will be an added advantage. \r\n(2) Minimum of 18 years of broad experience in the finance function in banks/large corporates/ PSUs/ FIs/ financial services organization is essential, out of which minimum 10 years of experience in Banks/FIs.\r\n\r\nSelection Process:\r\n\r\n(1) For Assistant Manager Posts -> Online Test, Interview and/ or Group Discussion only. \r\n(2) For AGM, DGM, CFO Posts -> Shortlisted candidates will be called for Personal Interview.\r\n\r\nApplication Fee: Online payment of â¹ 500/- as non-refundable application fee for General, OBC, Ex-Servicemen, J & Domicile and 1984 riot candidates. The Online payment of â¹ 50/- as non-refundable communication charges for SC/ST candidates who are applying for post of Assistant Managers.\r\n\r\nHow to Apply: Eligible Candidates can apply online only. The last date for submission of online applications is 20/11/2016 (Last date extended up to 30/11/2016).\r\n\r\nImportant Dates:\r\n\r\nClosing date for Online registration of application -> 30/11/2016 \r\nClosure for editing application details -> 30/11/2016 \r\nLast date for printing your application -> 15/12/2016 \r\nOnline Fee Payment -> 27/10/2016 to 30/11/2016\r\n\r\n\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0),
(165, 7, 0, 1, 'NMRC , NOIDA METRO', 'Noida Metro Rail Corporation Limited (NMRC) required young, dynamic and motivated Indian Citizens for opening of following Non-Executive Recruitment positions in NMRC Company 2016-2017. The NMRC Recruitment 2016-17 Online registration open from 5th November 2016 and close on 15th December 2016.\r\n\r\nADVT NO: NMRC / OM / HR /I/ 2016\r\n\r\nPost Code\r\n\r\nName of Post\r\n\r\nTotal Vacancies\r\n\r\nPay Grade (IDA)\r\n\r\nNE01\r\n\r\nStation Controller/ Train Operator (SC/TO)\r\n\r\n194 (38 Vacancy reserved for Female)\r\n\r\nâ¹ 13500Â­ - 25520\r\n\r\nNE 02\r\n\r\nCustomer Relations Assistant (CRA)\r\n\r\n65 (13 Vacancy reserved for Female)\r\n\r\nâ¹ 10170 - Â­18500\r\n\r\nNE 03\r\n\r\nJunior Engineer/ Electrical\r\n\r\n59 (11 Vacancy reserved for Female)\r\n\r\nâ¹ 13500Â­ - 25520\r\n\r\nNE 04\r\n\r\nJunior Engineer/ Electronics\r\n\r\n63 (12 Vacancy reserved for Female)\r\n\r\nâ¹ 13500Â­ - 25520\r\n\r\nNE 05\r\n\r\nJunior Engineer/ Mechanical\r\n\r\n18 (03 Vacancy reserved for Female)\r\n\r\nâ¹ 13500 - Â­25520\r\n\r\nNE 06\r\n\r\nJunior Engineer/ Civil\r\n\r\n20 (04 Vacancy reserved for Female)\r\n\r\nâ¹ 13500Â­ - 25520\r\n\r\nNE 07\r\n\r\nAccount Assistant\r\n\r\n08 (01 Vacancy reserved for Female)\r\n\r\nâ¹ 10170 - Â­18500\r\n\r\nNE08\r\n\r\nOffice Assistant\r\n\r\n06 (01 Vacancy reserved for Female)\r\n\r\nâ¹ 10170 - Â­18500\r\n\r\nNE09\r\n\r\nStenographer\r\n\r\n01\r\n\r\nâ¹ 10170 - Â­18500\r\n\r\nNE10\r\n\r\nMaintainer\r\n\r\n311 (Electrician - 112, Fitter - 55, Electronic Mechanic - 129, Ref & AC Mechanic - 15) [61 reserved for Female]\r\n\r\nâ¹ 8000 - Â­14140\r\n\r\nAge Limit (as on 01/07/2016): 18 to 25 Years for Maintainer Post; 18 to 28 Years for all other posts.\r\n\r\nEducational Qualifications: [From a Government Recognized University / Institute]\r\n\r\nStation Controller/ Train Operator -> 03 Years Engineering Diploma in Electrical/ Electronic or equivalent or B.Sc Hons in (Physics/ Chemistry/ Maths) or B.Sc (Physics/ Chemistry/ Maths).\r\n\r\nCustomer Relations Assistant -> Three/Four years Graduation course in any discipline and computer literacy (Certificate in Computer Application Course of a minimum 6 weeks duration).\r\n\r\nJunior Engineers -> Three years Engineering Diploma in concerned discipline (Civil / Electrical / Electronics / Mechanical) or equivalent trade.\r\n\r\nAccount Assistant â> B.Com Degree or equivalent graduation.\r\n\r\nOffice Assistant -> Bachelor\'s Degree (B.A./ B.Sc./ B.Com) or Equivalent.\r\n\r\nStenographer -> Any Degree with 01 Year course in Office Management and Secretarial Practice/ equivalent. Shorthand Speed-80 wpm/ English, Typing Speed-40 wpm/ English, Desirable - proficiency in shorthand/ typing in Hindi.\r\n\r\nMaintainer -> ITI (NCVT/SCVT) in required trade (Electrician / Fitter / Electronic Mechanic / Ref & AC Mechanic).\r\n\r\nSelection process:\r\n\r\n(1) For the post of Station Controller/ Train Operator (post code-NE01) and Customer Relations Assistant (post code-NE02) -> the selection methodology will comprise four-stage process:- Written Test (two papers), Psycho Test (qualifying) & Personal Interview followed by Medical examination in Aye-one category. \r\n\r\n\r\n(2) For the post of Junior Engineers (Electrical/Electronics/Mechanical/Civil), (post codes NE03, NE04, NE05, & NE06) -> the selection methodology will comprise three-stage process:- Written Test (two papers), Personal Interview followed by Medical examinations in Aye-one category not below Aye-three. \r\n(3) For the post of Account Asstt, Office Asstt & Stenographer (post codes NE07, NE08 & NE09) -> the selection methodology will comprise two-stage process:- Written Test (two papers), followed by Medical examination in Cee-One category. There will be no interview for this category of post. \r\n(4) For the post of Maintainer (post codes NE10) -> the selection methodology will comprise two-stage process:- Written Test (one paper), followed by Medical examination in Bee-One category. There will be no interview for these categories of posts.\r\nApplication Fee (A Non-refundable fee): The candidates belonging to General (UR) and OBC category are required to pay â¹ 400/- (plus Bank Charges), for candidates belonging to SC/ST/PWD category are required to pay â¹ 150/- (plus Bank Charges). The fee can be made through Prescribed Bank Challan. The Bank challan will be available to download after filling online application, The system generated Bank challan will be in triplicate (1st copy - Bank Copy, 2nd copy - Candidate\'s Copy and 3rd copy - NMRC\'s Copy). Candidates are required to take a print out of this system generated Bank Challan and deposit the requisite Written Examination Fee (for fee details see para \"Payment of application fee\") in any branch of State Bank of India (SBI) after a minimum of 24 hrs of generation of the Bank Challan. Only, State Bank of India (SBI) has been authorized by DMRC to collect the application fee, in a specially opened DMRC Account No. 33700092265.\r\n\r\nHow to Apply: Candidates are required to apply online through Delhi Metro Rail Website. The last date for registration of Online applications is 15/12/2016 (19/12/2016 â According to New press release) up to 23:59 Hours. For any clarification / queries email to helpdesknmrc2016@gmail.com .\r\n\r\nImportant Dates:\r\n\r\nThe Closing date for Online Registration -> 15th December 2016 up to 23:59 Hours. \r\nThe Application Fee to be Paid -> From 7th November 2016 to 19th December 2016. \r\nBank Challan will be generated up to -> 15th December 2016 up to 23:59 Hours.\r\n\r\n\r\n\r\n', '2016-11-27', '2016-12-07', 0, 0, 0, 0),
