(172, 7, 0, 1, 'IDBI Bank-111 Manager, AGM & DGM', 'IDBI Bank Vacancy Details:\r\nTotal No. of Posts: 111\r\nName of the Posts:\r\n1. Deputy General Manager (Grade D): 13 Posts\r\n2. Assistant General Manager (Grade C): 17 Posts\r\n3. Manager (Grade B): 81 Posts\r\n\r\nAge Limit: Candidates age limit should be 35 â 40/ 45 years for Post 1, 30 â 36 years for Post 2, 28 â 32 years for Post 3 as on 01-10-2016. Age relaxation is applicable to SC/ ST/ OBC/ Person with disabilities (PWD)/ Ex-Servicemen as per rules.\r\n\r\nEducational Qualification: Candidates should possess Graduation with first class in any stream from a recognized University/ Graduation in B.Sc Agri or Veterinary Science or in any allied courses in Agri from a recognized University or Graduation in any discipline from a recognized University with Post Graduate qualification as M. Tech. Agri or MBA Agri or M.Sc in relevant discipline. For more details refer the notification.\r\n\r\nSelection Process: Candidates will be selected based on group discussion & personnel interview for Post 1, online written test, personnel interview for post 2, 3.\r\n\r\nApplication Fee: Candidates should pay Rs. 150/- (Intimation Charges) for SC/ ST/ PWD candidates and Rs. 700/- (Application fee + Intimation Charges) for all other candidates through online by using Debit Cards (RuPay/ Visa/ MasterCard/ Maestro), Credit Cards, Internet Banking, IMPS, Cash Cards/ Mobile Wallets.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.idbi.com from 01-02-2017 to 20-02-2017.\r\nImportant Dates:\r\nStarting Date to Apply Online & Payment of Fee: 01-02-2017.\r\nLast Date to Apply Online, Editing Applications & Payment of Fee: 20-02-2017.\r\nLast Date for Printing Applications: 07-03-2017.\r\nDate of Pre- Examination Training for SC/ ST/ OBC candidates: 14-03-2017 to 19-03-2017.\r\nDate of Online Test at all centers: 24-03-2017.\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0),
