(175, 7, 0, 1, 'HARYANA SCC -2017--5532 Constable Posts', 'HSSC Vacancy Details:\r\nTotal No. of Posts: 5532\r\nName of the Posts:\r\n1. Male Constable: 4500 Posts\r\ni. Gen: 1300 posts\r\nii. SC: 900 Posts\r\niii. BCA: 700 Posts\r\niv. BCB: 400 Posts\r\nv. EBPG: 500 Posts\r\nvi. ESM- Gen: 350 Posts\r\nvii. ESM -SC: 100 Posts\r\nviii. ESM- BCA: 100 Posts\r\nix: ESM- BCB: 150 Posts\r\n2. Female Constable: 1032 Posts\r\ni. Gen: 298 Posts\r\nii. SC: 206 Posts\r\niii. BCA: 161 Posts\r\niv. BCB: 92 Posts\r\nv. EBPG: 115 Posts\r\nvi. ESM- Gen: 80 Posts\r\nvii. ESM -SC: 23 Posts\r\nviii. ESM- BCA: 23 Posts\r\nix: ESM- BCB: 34 Posts\r\n\r\nAge Limit: Candidates age limit should be between 18 â 25 years as on 01-02-2017. Age relaxation is applicable as per Haryana Govt. instructions.\r\n\r\nEducational Qualification: Candidates should possess 10+2 with Knowledge of Hindi/ Sanskrit up to Matric standard.\r\n\r\nSelection Process: Candidates will be selected based on Physical Screening Test, Knowledge Test, Physical Measurement Test, Interview-cum-Personality Test.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- for male, female, Rs. 50/- for female of Haryana resident only, Rs.25/- for male, Rs. 13/- for female for SC/ BC/ SBC/ EB PG candidates of Haryana State only through Net banking or e-Challan in any branch of State Bank of India, State Bank of Patiala, Punjab National Bank and IDBI Bank etc.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.hssc.gov.in from 10-02-2017 to 28-02-2017 till 11:59 PM.\r\n\r\nImportant Dates:\r\nStarting Date to Apply Online: 10-02-2017.\r\nLast Date to Apply Online: 28-02-2017 till 11:59 PM.\r\nLast Date for Deposit of Fee: 02-03-2017 by 11:59 PM.\r\n\r\n\r\n\r\nHSSC Vacancy Details:\r\nTotal No. of Posts: 2459\r\nName of the Posts/ Department:\r\n1.Land Records Department: 02 Posts\r\na. Assistant Research Officer: 01 Post\r\nb. Draftsman: 01 Post\r\n2. Food & Supplies: 24 Posts\r\na. Assistant Food & Supplies Officer: 24 Posts\r\n3. Animal Husbandry & Dairying: 14 Posts\r\na. Lab Technician: 14 Posts\r\n4. Printing & Stationery: 14 Posts\r\na. Section Holder (Binding): 01 Post\r\nb. Assistant Section Holder (Binding): 01 Post\r\nc. Reader: 01 Post\r\nd. Computer: 02 Posts\r\ne. Offset Inker: 05 Posts\r\nf. Press Mechanic: 03 Posts\r\ng. Personal Computer with Advance Technology (PCAT): 01 Post\r\n5. Haryana State Pollution Control Board: 01 Post\r\na. Senior Scientific Assistant: 01 Post\r\n6. Higher Education: 14 Posts\r\na. Assistant (Field Offices): 14 Posts\r\n7. Foods & Drugs Administration: 05 Posts\r\na. Senior Analytical Assistance: 02 Posts\r\nb. Statistical Assistant: 01 Post\r\nc. Junior Scientific Officer: 02 Posts\r\n8. Women & Child Development: 263 Posts\r\na. Supervisor (Female): 137 Posts\r\nb. Supervisor (Female): 126 Posts\r\n9. PWD B&R Branch: 127 Posts\r\na. Chargeman Electrical: 11 Posts\r\nb. Chargeman (AC): 02 Posts\r\nc. Carpenters: 02 Posts\r\nd. Motor Winder: 02 Posts\r\ne. Lift Operator: 01 Post\r\nf. Store Keeper: 02 Posts\r\ng. General Operator: 01 Post\r\nh. Mechanic AC &Refrigeration: 07 Posts\r\ni. Electrician: 99 Posts\r\n10. Health Services: 28 Posts\r\na. Family Welfare Extension Educator: 18 Posts\r\nb. Statistical Assistant: 10 Posts\r\n11. Public Health Engineering: 915 Posts\r\na. Water Pump Operator Grade-II: 681 Posts\r\nb. Electrician Grade-II: 28 Posts\r\nc. Pipe Fitter Grade-II: 108 Posts\r\nd. Work Supervisor: 29 Posts\r\ne. Plumber Grade-II: 11 Posts\r\nf. Diesel Auto Motor Mech: 05 Posts\r\ng. Welder: 02 Posts\r\nh. Strata Observer: 09 Posts\r\ni. Store Munshi: 05 Posts\r\nj. Well Borer: 09 Posts\r\nk. Compressor Driver/ Gas Driver: 04 Posts\r\nl. Painter Grade-II: 06 Posts\r\nm. Card Clerk: 01 Post\r\nn. Mechanical Fitter Grade-II: 07 Posts\r\no. Meter Reader/ Bill Clerk: 10 Posts\r\n12. Elementary Education: 664 Posts\r\na. TGT Sanskrit (Rest of Haryana): 483 Posts\r\nb. TGT Sanskrit (Mewat Cadre): 181 Posts\r\n13. Forest Department: 331 Posts\r\na. Forest Guard: 331 Posts\r\n14. Urban Local Bodies: 12 Posts\r\na. Secretary in Municipal Committee: 09 Posts\r\nb. Executive Officer: 03 Posts\r\n15. Haryana State Agriculture Marketing Board: 44 Posts\r\na. Divisional Accountant: 04 Posts\r\nb. Electronic Data Processing Assistant (EPDA): 02 Posts\r\nc. Sub Divisional Clerk: 26 Posts\r\nd. Assistant: 12 Posts\r\n16. Development & Panchayats: 01 Post\r\na. Librarian: 01 Post\r\n\r\nAge Limit: Candidates age limit should be between 22-42 Years for Post 1a, 17-42 Years for Post 1b, 2a, 3a, 4a, 4b, 4c, 4d, 4e, 4f, 4g, 5a, 6a, 7a, 7b, 7c, 8a, 9a, 9b, 9c, 9d, 9e, 9f, 9g, 9h, 9i, 10a, 10b, 11a to 11o, 13a, 14a, 14b, 15a to 15d, 16a, 17-45 years for Post 8b, 18-42 years for Post 12a, 12b. Age relaxation is applicable as per rules.\r\n\r\nEducational Qualification: Candidates should possess Masters Degree Economics/ Agriculture Economics/ Mathematics/ Commerce/ Statistics, Graduation in in Mathematics/ Economics/ Agriculture Economics/ Commerce/ Statistics for Post 1a, Matric, Hindi/ Sanskrit upto Matric standard or Higher Education, pass Draftsman in Civil for Post 1b, Graduation Degree for Post 2a, 10+2 (Science), Diploma in Veterinary Laboratory Technology (DVLT) for Post 3a, Matric with Hindi, Diploma in Printing Technology for Post 4a, 4b, Graduation for Post 5 with Knowledge of Hindi/ Sanskrit upto Matric or Higher education with relevant experience. For more information refer the notification.\r\n\r\nSelection Process: Shortlisted candidates will be called for written exam/ interview/ verification..\r\n\r\nApplication Fee: Candidates should pay Rs. 150/- for General (Male/ Female Candidates), Rs 75/- for General (Female of Haryana resident only), Rs. 35/- for SC/ BC/ SBC/ EBPG candidates of Haryana State only (Male Candidates) and Rs. 18/- for SC/ BC/ SBC/ EBPG candidates of Haryana State only (Female Candidates) for Posts 1a to 4a, 4g to 8b, 10a, 12a, 12b, 14a, 16a and Rs. 100/- for General (Male/ Female Candidates), Rs 50/- for General (Female of Haryana resident only), Rs. 25/- for SC/ BC/ SBC/ EBPG candidates of Haryana State only (Male Candidates) and Rs. 13/- for SC/ BC/ SBC/ EBPG candidates of Haryana State only (Female Candidates) for Post 4b to 4f, 9a to 9i, 11a to 11o, 13a to be deposited through Net banking or e-Challan in any branch of State Bank of India, State Bank of Patiala, Punjab National Bank and IDBI Bank.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.hssc.gov.in from 16-01-2017 to 15-02-2017 till 11:59 PM.\r\n\r\nInstructions to Apply Online:\r\n1. Candidates should log on through the website www.hssc.gov.in\r\n2. Select the desired post\r\n3. Click on Login & Enter the details.\r\n4. Click on Register if he/ she would be new user.\r\n5. Fill all the details carefully & submit form.\r\n6. Take printout of application for future use.\r\n\r\nImportant Dates:\r\n\r\nDate of Publication	30-12-2016\r\nStarting Date to Apply Online	16-01-2017\r\nLast Date to Apply Online	15-02-2017 till 11:59 PM\r\nLast Date for Deposit of Fee	17-02-2017 by 11:59 PM\r\n\r\n\r\nHSSC Recruitment 2017 â Apply Online for 509 Constable (Telecommunication) Posts: Haryana Staff Selection Commission (HSSC) has invited applications for the recruitment of 509 Constable (Male) vacancies for Telecommunication Wing on direct recruitment basis. Eligible candidates may apply online from 20-02-2017 to 20-03-2017 till 11:59 PM. Other details like age limit, educational qualification, selection process & how to apply are given belowâ¦.\r\n\r\nHSSC Vacancy Details:\r\nTotal No. of Posts: 509\r\nName of the Posts: Constable (Male) for Telecommunication Wing\r\ni. Gen: 148 posts\r\nii. SC: 102 Posts\r\niii. BCA: 79 Posts\r\niv. BCB: 45 Posts\r\nv. EBPG: 56 Posts\r\nvi. ESM- Gen: 40 Posts\r\nvii. ESM -SC: 11 Posts\r\nviii. ESM- BCA: 11 Posts\r\nix: ESM- BCB: 17 Posts\r\n\r\nAge Limit: Candidates age limit should be between 18 â 25 years as on 01-02-2017. Age relaxation is applicable as per Haryana Govt. instructions.\r\n\r\nEducational Qualification: Candidates should possess 10+2 with Knowledge of Hindi/ Sanskrit up to Matric standard.\r\n\r\nSelection Process: Candidates will be selected based on Physical Screening Test, Knowledge Test, Physical Measurement Test, Interview-cum-Personality Test.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- for General, Rs. 25/- for SC/ BC/ SBC/ EB PG candidates of Haryana State only through Net banking or e-Challan in any branch of State Bank of India, State Bank of Patiala, Punjab National Bank and IDBI Bank etc. No fee for Ex- Serviceman of Haryana.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.hssc.gov.in from 20-02-2017 to 20-03-2017 till 11:59 PM.\r\n\r\nImportant Dates:\r\nStarting Date to Apply Online: 20-02-2017.\r\nLast Date to Apply Online: 20-03-2017 till 11:59 PM.\r\nLast Date for Deposit of Fee: 22-03-2017 by 11:59 PM.\r\n\r\n\r\n\r\nHSSC Vacancy Details:\r\nTotal No. of Posts: 54\r\nName of the Post: \r\n1. Male Constable in Mounted Armed Police (MAP): 36 Posts\r\na. General: 10 Posts\r\nb. SC: 07 Posts\r\nc. BCA: 06 Posts\r\nd. BCB: 03 Posts\r\ne. EBPG: 04 Posts\r\nf. ESM-GEN: 03 Posts\r\ng. ESM-SC: 01 Post\r\nh. ESM-BCA: 01 Post\r\ni. ESM-BCB: 01 Post\r\n2. Male Constable Bandsman: 18 Posts\r\na. Gen: 05 Posts\r\nb. SC: 04 Posts\r\nc. BCA: 03 Posts\r\nd. BCB: 02 Posts\r\ne. EBPG: 02 Posts\r\nf. ESM-GEN: 01 Post\r\ng. ESM-BCB: 01 Post\r\n\r\nAge Limit: Candidates age limit should be 18-25 years as on 01-02-2017.Age relaxation is applicable as per rules.\r\n\r\nEducational Qualification: Candidates should have passed Matriculation from the Board of School Education, Haryana or any other Board & have Knowledge of Hindi/ Sanskrit up to Matric standard.\r\n\r\nSelection Process: Shortlisted candidates will be called for Physical Screening Test, Knowledge Test, Skill Test, Physical Measurement Test, and Written Exam & Interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- for General, Rs. 25/- for SC/ BC/ EBPG candidates through Net banking or e-Challan in any branch of State Bank of India, State Bank of Patiala, Punjab National Bank and IDBI Bank etc.\r\n\r\nHow to Apply: Eligible candidates may apply online through the website www.hssc.gov.in from 16-02-2017 to 14-03-2017 by11:59 PM\r\n\r\nImportant Dates:\r\n\r\nDate of Publication	03-02-2017\r\nStarting Date to Apply Online	16-02-2017\r\nLast Date to Apply Online	14-03-2017 by11:59 PM\r\nLast Date for Deposit of Fee	16-03-2017 by 11:59 PM\r\n\r\n', '2017-02-11', '2017-02-21', 0, 0, 0, 0),
