(207, 7, 0, 1, 'Apply Online for Combined Graduate Level Exam', 'SSC Vacancy Details:\r\nName of the Exam: Combined Graduate Level Exam 2017\r\nName of the Post:\r\n1. Assistant Audit Officer (Post Code: F)\r\n2. Assistant Accounts Officer (Post Code: $)\r\n3. Assistant Section Officer (Post Code: A)\r\n4. Assistant Section Officer (Post Code: C)\r\n5. Assistant Section Officer (Post Code: D)\r\n6. Assistant Section Officer (Post Code: E)\r\n7. Assistant Section Officer (Post Code: G)\r\n8. Assistant (Post Code: H)\r\n9. Asst (Post Code: >)\r\n10. Assistant Section Officer (Post Code: <)\r\n11. Assistant (Post Code: I)\r\n12. Assistant/ Superintendent (Post Code: &)\r\n13. Inspector of Income Tax (Post Code: J)\r\n14. Inspector, (Central Excise) (Post Code: K)\r\n15. Inspector (Preventive Officer) (Post Code: L)\r\n16. Inspector (Examiner) (Post Code: M)\r\n17. Assistant Enforcement Officer (Post Code: N)\r\n18. Sub Inspector (Post Code: O)\r\n19. Inspector (Post Code: P)\r\n20. Divisional Accountant (Post Code: Q)\r\n21. Inspector (Post Code: S)\r\n22. Sub Inspector (Post Code: %)\r\n23. Junior Statistical Officer (Post Code: R)\r\n24. Auditor (Post Code: T)\r\n25. Auditor (Post Code: U)\r\n26. Auditor (Post Code: V)\r\n27. Accountant/ Junior Accountant (Post Code: W)\r\n28. Accountant/ Junior Accountant (Post Code: X)\r\n29. Senior Secretariat Assistant/ Upper Division Clerk (Post Code: Y)\r\n30. Tax Assistant (Post Code: Z)\r\n31. Tax Assistant (Post Code: @)\r\n32. Sub Inspector (Post Code: #)\r\n\r\nAge Limit: Candidates age limit should be not exceeding 30 years (He/ she must have been born not earlier than 02-08-1987 and not later than 01-08-1999) for Post No. 01, 02, 04, 10, 12, 13 to 17 & 20, between 20 â 30 years (He/ she must have been born not earlier than 02-08-1987 and not later than 01-08-1997) for Post No. 03, 05 to 07, 09 & 18 and 18 â 27 years (He/ she must have been born not earlier than 02-08-1990 and not later than 01-08-1999) for Post No. 08 & 11 as on 01-08-2017. For more age details refer the notification. Age relaxation is applicable to 05 years for SC/ ST candidates, 03 years for OBC, 10 years for PH, 13 years for PH + OBC and 15 years for PH + SC/ ST candidates. For more relaxation details refer the notification.\r\n\r\nEducational Qualification: Candidates should possess Bachelorâs Degree from a recognized University or Institute for Post No. 01 to 22 & 24 to 32 and Bachelorâs Degree in any subject from a recognized University or Institute with at least 60% Marks in Mathematics at 12th standard level or Bachelorâs Degree in any subject with Statistics as one of the subjects at degree level for Post No. 23 with relevant experience.\r\n\r\nSelection Process: Candidates will be selected based on Computer Based Examination, Descriptive Test, Skill Test, Documents Verification  & Interview.\r\n\r\nApplication Fee: Candidates should pay Rs. 100/- through SBI Challan/ SBI Net banking or through credit/ debit cards of any bank.\r\n\r\n\r\n\r\n', '2017-05-18', '2017-05-28', 0, 0, 0, 0),
