(476, 'MAHARAJA HOTEL', '1542462955', 'maharajahotelsgnr@gmail.com', 'maharaja955', '7c25b6ebd1fb705f8dd3ccdbf6c810b8', 'NH-62, Near Nissan Singh Petrol Pump\nSuratgarh Road,\n Sri Ganganagar\nPH: 0154-2462955\n0154-2463955\nMr Ramesh Verma\n94624-86955', '2925', 0, '0000-00-00 00:00:00', 65, 1, 1, 0, 1, 'MAHARAJA HOTEL', '1542462955', 'maharaja9557c25', 0, 6, 'MAHARAJA HOTEL\n\nVisit us on \nwww.maharajahotel.co.in\n\nOnly the most comfortable and modern hotel in the town which is located on NH-62,Suratgarh road and approx 1 km from bus stand & railway station.\nThe Hotel has graceful architecture blends aesthetically with modern facilities\n\nâSpacious Room\nâ Restaurant\nâ Bar\nâ For Entertainment LCD\nâ Round the clock room service\nâ Lift facility\nâ Mini Bar\nâ Internet Facility\nâ Individual Climate control\nâ Same day laundry\nâ 100 % Power backup\nâ Sound proof Windows\nâ MASTER & VISA Cards accepted.\nâ Doctor on call\nâ Baggage storage\nâ Secure Parking for self driven cars\nâ Accommodation for Drivers in common Dormitory.\nâ Party Hall\nâ Conference Hall\n\nâ RESTAURANTâ\n\nDiscover the delights of fine Cuisine- Indian, Mughlai, American\nContinental & Chinese food with impressive menu & Impeccable service.\n\nâ Home delivery available\n\nãROOM TARIFFã\nâ Deluxe\nSingle 2200/-\nDouble 2550/-\n\nâSuper Deluxe\nSingle 2600/-\nDouble 2950/-\n\nâ Maharaja Suite\nSingle/Double\n2990/-\nExtra Person Charge 400/-\n', 0, 0, 0),
(477, 'PHOENIX ACADEMY', '1516550104', '', 'phoenix104', 'f67b1f5ee338459c49c331224c051c14', 'A-156 SADULGANG\nOPPOSITE SBI BANK,\nPANCHSHATI CIRCLE\nPH : 0151- 6550105', '2989', 0, '0000-00-00 00:00:00', 23, 4, 1, 0, 1, 'PHOENIX IIT ACADEMY', '1516550104', 'phoenix104f67b1', 0, 6, 'PHOENIX ACADEMY\n( IIT PREPARATION SPECIALIST )\n\nRISE,DREAM,FLY\n\nABOUT PHOENIX.....\n\nPhoeniox Academy is a premier coaching institute for the preparation of IIT-JEE, Pre-medical (AIPMT/AIIMS), Pre-Nurture (Class VIII to X) & Career Foundation. Our vision is to be the most trusted and successful training institution \"Exclusively for IIT-JEE\"\r\n\nCOURSES:-\nPre-Nurture Wing - Class 7th | 8th | 9th\n\nFIRE OF PHOENIX: âThree Years Foundation Course for Class Xâ\r\n(For Class 9th to 10th Moving Students)\n\nRISE OF PHOENIX: âTwo Years Foundation Course for Class XIâ\r\n(For Class 10th to 11th Moving Students)\n\nFLIGHT OF PHOENIX\r\nFor class 11th to 12th moving students\n\nFLIGHT OF PHOENIX\r\nFor class 11th to 12th moving students\n\nDETAILED INFORMATION ABOUT ALL COURSES AVAILABLE ON OUR WEBSITE:--\nwww.phoenix.ac.in\n\nOUR INNOVATIONS:--\n\nMASTER STROKE\nPHOENIX FRIEND\nDREAM OF PHOENIX\nPHOENIX TIMES MAGZINE\nPHOENIX SCHOLARSHIP PROGRAMME\n\n\nPHOENIX IIT ACADEMY INFRASTRUCTURE\n(CAMPUS AND HOSTEL )\r\n\r\n*First ever institute of Bikaner to have Physics and Chemistry Lab facilities in the institute campus.\r\n*First ever institute of Bikaner to have Digital Smart Classes for IIT JEE preparation.\r\n*First ever institute of Bikaner to have computer lab for online pattern of IIT-JEE in future, with fully prepared online tests.\r\n*First ever institute of Bikaner to have a rich library with separate study areas and doubt classes.\r\n*First ever institute of Bikaner to have a separate state-of-the-art conference hall for mentor ship programs and motivational seminars.\r\n*First ever institute of Bikaner to have fully air-conditioned classrooms.\r\n*First ever institute of Bikaner to understand and maintain least student - teacher ratio.\r\n*First ever institute of Bikaner to have coaching and hostel facilities in the same campus.\n\r\nPhoenix IIT Academy is located in the heart of the city, free from sound and air pollution. \nHostel facility is available in the same campus for outside students along with clean and hygienic dining hall. \nSpecial care has been taken for maintaining proper light and ventilation, hygienic toilets, filtered drinking water and ample parking space. \nTransportation facility is arranged for the students.\nManagement team of Phoenix IIT Academy strives to maintain the highest quality infrastructure for students and faculties.', 0, 0, 29),
