(737, 'APPLE', '02912556803', 'hotelapple@live.com\nWEBSITE : www.hotelapple.com', 'apple0291', 'd53d3f5c1824e78341589f6fde82d57c', '23-A SHANTI NAGAR, 1 STREET , NEAR RELIANCE FRESH PAOTA \'C\' ROAD ', '4345', 0, '0000-00-00 00:00:00', 65, 5, 1, 0, 1, 'APPLE', '9530346345', 'apple0291d53d3', 0, 6, '* APPLE \n\n* HOME STAY & ROOF RESTAURANT \n\n* Welcome to one of the best run Jodhpur hotels. Hotel Apple Jodhpur is a modern heritage hotel with a budget hotel tariff providing world class Rajasthani style accommodation. Our hotel is highly recommended by Lonely Planet, Let\'s go, Foot print travel guides on Jodhpur Hotels and Jodhpur Budget Hotels.\n\nRun by a family of Jain, Hotels Jodhpur - Hotel Apple is one of theÂ finest hotels in Jodhpur. Built in traditional style, there are beautifully carved balconies, attractive courtyards, open terraces, lovely garden and comfortable rooms with antique furnishings. Hotel Apple offers unique exotic traditional Rajasthani ambience found only in some of the Hotels in Jodhpur.\n\nRanked as one of theÂ best run budget hotels in JodhpurÂ by the Lonely Planet international travel guide book, Hotel Apple offers guests a pleasant and comfortable home away from home with traditional Rajput hospitality.\n\n* HOTEL & ROOM SERVICE\n\n* AIR CONDITIONED ROOMS,SUITES \n\n* RAJASTHANI CUISINE \n\n* STUDY DESKS IN ROOM \n\n* DIRECT CABEL TELEVISION \n\n* EUROPEAN STYLE BATHROOM \n\n* MULTI CUISINE RESTAURANT \n\n* 24 HRS FRONT DESK \n\n* CAR HIRE SERVICE \n\n* LAUNDRY AND DRY CLEAN \n\n* POSTAL / PARCEL SERVICE \n\n* DAILY NEWS PAPER \n\n* AYURVEDIC  MASSAGE \n\n* BANQUET FACILITY \n\n* SAFE DEPOSIT LOCKERS \n\n* VALET PARKING \n\n* TRAVEL ASSISTANCE\n\n* DESERT SAFARI \n\nVISIT US ON :\nwww.hotelapple.com\n\n\n* Write us on :  \ninfo@hotelapple.com\nhotelapple@live.com\n\n\n* CONTACT US ON \n\n* +91-2912556803\n\n* +91-95303-46343\n   +91-94143-82945\n   +91-82902-11745', 0, 0, 0),
